import Link from 'next/link';
const Navigation = () => {
    return ( 
        <div>
            <ul>
                <li><Link href="/"><a>Inicio</a></Link></li>
                <li><Link href="/nosotros"><a>Nosotros</a></Link></li>
             </ul>

        <style jsx>{`
            ul {
                background-color:#333;
                list-style:none;
                display:flex;

            }

            ul li a{
                font-size:1.2rem;
                color:#fff;
            }

        `}
        </style>
        </div>
     );
}

export default Navigation;
